(function($, Drupal, drupalSettings) {

  Drupal.behaviors.mbf_core = {
    attach: function (context, settings) {

      /**
      * Close event to hide system messages.
      */
      var messages = $('.messages');

      // Inject Close or Close all button to messages but not on .webfrom-message__link. //
      if ( $('.webform-message__link').length <= 0 ) {
        if ( messages.length <= 1 ) {
          messages.append('<div class="close-button"><span class="close">Close</span></div>');
        } else {
          messages.append('<div class="close-button"><span class="close">Close</span> | <span class="close-all">Close all</span></div>');
        }
        
        // Fade out the message(s) when clicked. //
        $('body').once('messages-close').on('click', '.messages .close', function() {
          $(this).closest('.messages').fadeOut();
        });

        $('body').once('messages-close-all').on('click', '.messages .close-all', function() {
          messages.fadeOut();
        });
      }

    }
  }; //Drupal.behaviors.mbf_core

})(jQuery, Drupal, drupalSettings);
