(function($) {

  $.fn.mbf_accordion = function(options) {

    var settings = $.extend({
      accordionItem: '',
      slideElement: '',
      noSlideElement: '',
      icon: false,
      iconElement: false,
      iconCustomHtml: false,
      parentItem: '.field__item',
      containerItem: '',
      maxWidth: -1,
      openClass: 'open',
      openedClass: 'opened',
    }, options );

    $(this).click(function() {

      if (settings.maxWidth === -1 || $(window).innerWidth() <= settings.maxWidth) {

        var parentItem = $(this).closest(settings.parentItem);

        if (parentItem.hasClass(settings.openClass)) {

          // Close item clicked
          parentItem.removeClass(settings.openClass).removeClass(settings.openedClass);
          $(settings.slideElement, parentItem).slideUp(500, function () {
            // If inside a tab, check to update height.
            insideTab(this);
          });

        }
        else {

          // Close siblings
          $(settings.accordionItem, $(this).closest(settings.containerItem)).removeClass(settings.openClass).removeClass(settings.openedClass);
          $(settings.slideElement, $(this).closest(settings.containerItem)).slideUp(500);

          // Open item clicked
          parentItem.addClass(settings.openClass);
          $(settings.slideElement, parentItem).slideDown(500, function () {
            $(this).closest(settings.parentItem).addClass(settings.openedClass);

            // If inside a tab, update height.
            insideTab(this);
          });

          // Refresh any slicks inside the accordion.
          if ($('.slick-slider', $(settings.slideElement, parentItem)).length) {
            $('.slick-slider', $(settings.slideElement, parentItem)).slick("refresh");
          }

        }
      }
    });//click

    // If inside a tab, update height.
    function insideTab(element) {
      var tabs = $(element).closest('.field--name-field-o-tabs-items');
      if (tabs) {
        var tabHeight = $('> .slick-list > .slick-track > .slick-active', tabs).height();
        $('> .slick-list', tabs).addClass('animate-height').height(tabHeight);
        setTimeout(function (){
          $('.slick-list').removeClass('animate-height');
        }, 400);
      }
    }

    if (settings.maxWidth === -1 || $(window).innerWidth() <= settings.maxWidth) {
      $(settings.slideElement, $(settings.accordionItem + '.' + settings.openClass + '.' + settings.openedClass)).once('accordion-init').css('display', 'block');
    }

    return this;

  }//$.fn.mbf_accordion

})(jQuery);
